var main = document.getElementById("main");
var brand = document.getElementById("brand");
var model = document.getElementById("model");
brand.innerHTML = `<option>Select brand</option>`
model.innerHTML = `<option>Select model</option>`


function displayAllMob(){
    main.innerHTML = " "
for (var key in mobile){
    brand.innerHTML+= `<option value = '${key}' >${key}</option>`
    for (var key1 in mobile[key]){
         var obj = mobile[key][key1];

         var colorDiv = "";
         for(var i=0 ; i< obj.color.length; i++){
            colorDiv += `<div class = '${obj.color[i]}'></div>`
         
         }
         main.innerHTML += `
     
         <div class="col-12 col-sm-12 col-md-6 col-lg-3 mb-5">
         <div class="card" style="width: 18rem;">
           <img src="${obj.image || "data:image/jpeg;base64,"}" class="card-img-top" alt="...">
           <div class="card-body">
             <h5 class="card-title">${key1.toUpperCase()}</h5>
             <p class="card-text">${obj.memory}
             <br />
             ${obj.camera}
             </p>
             <h6>${obj.price}</h6>

             <div class = "d-flex gap-2">${colorDiv}</div>
           </div>
         </div>
       </div>
         `

        }
    }

}

displayAllMob()

function setModel(){
    model.innerHTML = "";
    model.innerHTML = `<option>Select model</option>`

        for(var key in mobile[brand.value]){
            model.innerHTML += `<option value = '${key}' >${key}</option>`

        }
}


var mobDetail = document.getElementById('mob-detail');
function search(){
    console.log("Hello")

    main.style.display = "none";
    mobDetail.style.display = "flex"
    var mob = mobile[brand.value][model.value];
 
    mobDetail.innerHTML = `
    <div class="card mb-3" >
    <div class="row g-0">
      <div class="col-md-4">
        <img src="${mob.image || "data:image/jpeg;base64,"}" class="img-fluid rounded-start" alt="...">
      </div>
      <div class="col-md-8">
        <div class="card-body">
          <h5 class="card-title">${model.value.toUpperCase()}</h5>
          <p class="card-text">${mob.memory}
          <br />
          ${mob.camera}
          </p>
          <h6>${mob.price}</h6>
        </div>
      </div>
    </div>
  </div>`
}




function clear(){
    console.log("Hello")
    mobDetail.innerHTML = "";
    mobDetail.style.display = "none";
    main.style.display = "flex";
    displayAllMob()

}








